DROP TABLE IF EXISTS `auth_user`;
CREATE TABLE `auth_user` (
  `id` varchar(64) NOT NULL COMMENT 'uid,用户账号,主键',
  `mch_id` varchar(64) DEFAULT NULL,
  `admin` tinyint(4) DEFAULT '0' COMMENT '是否为管理员(0.否 1.是)',
  `username` varchar(30) DEFAULT NULL COMMENT '用户名(nick_name)',
  `password` varchar(50) DEFAULT NULL COMMENT '密码(MD5(密码+盐))',
  `salt` varchar(20) DEFAULT NULL COMMENT '盐',
  `real_name` varchar(30) DEFAULT NULL COMMENT '用户真名',
  `avatar` varchar(100) DEFAULT NULL COMMENT '头像',
  `phone` varchar(20) NOT NULL COMMENT '电话号码(唯一)',
  `email` varchar(50) DEFAULT NULL COMMENT '邮件地址(唯一)',
  `sex` tinyint(4) DEFAULT NULL COMMENT '性别(1.男 2.女)',
  `status` tinyint(4) DEFAULT NULL COMMENT '账户状态(1.正常 2.冻结 3.删除 4.非法)',
  `openId` varchar(50) DEFAULT NULL COMMENT '微信openid',
  `nickname` varchar(255) DEFAULT NULL COMMENT '微信用户呢称',
  `phone_bind` varchar(255) DEFAULT NULL COMMENT '手机绑定(0否1是)',
  `wx_bind` varchar(255) DEFAULT NULL COMMENT '微信绑定(0否1是)',
  `email_bind` varchar(255) DEFAULT NULL COMMENT '邮箱绑定(0否1是)',
  `temp_pwd` tinyint(4) DEFAULT '0' COMMENT '是否临时密码(0否1是)',
  `temp_pwd_time` datetime DEFAULT NULL COMMENT '临时密码创建时间',
  `real_name_auth` varchar(255) DEFAULT NULL COMMENT '实名认证(0否1是)',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `CREATE_WHERE` tinyint(4) DEFAULT NULL COMMENT '创建来源(1.web 2.android 3.ios 4.win 5.macos 6.ubuntu)',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `phone` (`phone`) USING BTREE,
  UNIQUE KEY `email` (`email`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='用户信息表';

