CREATE TABLE `t_mch_info` (
  `mch_id` varchar(32) NOT NULL COMMENT '商户ID',
  `name` varchar(255) NOT NULL COMMENT '名称',
  `name_short` varchar(30) NOT NULL COMMENT '商户简称',
  `type` varchar(24) NOT NULL COMMENT '类型',
  `req_key` varchar(128) NOT NULL COMMENT '请求私钥',
  `res_key` varchar(128) NOT NULL COMMENT '响应私钥',
  `state` tinyint(6) NOT NULL DEFAULT '1' COMMENT '商户状态,0-停止使用,1-使用中',
  `oper_pwd` varchar(255) DEFAULT NULL COMMENT '操作密码',
  `domain_name_status` tinyint(6) DEFAULT '0' COMMENT '域名验证状态,0-未验证,1-已验证',
  `return_url` varchar(255) DEFAULT NULL COMMENT '回调URL',
  `whitelist` text COMMENT '白名单',
  `enbale_amount` bigint(20) DEFAULT NULL COMMENT '可用余额',
  `frozen_amount` bigint(20) DEFAULT NULL COMMENT '冻结金额',
  `settlement_notify` tinyint(6) DEFAULT '1' COMMENT '结算通知(0关闭 1开启)',
  `refund_notify` tinyint(6) DEFAULT '0' COMMENT '退款通知(0关闭 1开启)',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `salt` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`mch_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='商户信息表';

-- ----------------------------
-- Records of t_mch_info
-- ----------------------------

-- ----------------------------
-- Table structure for `t_mch_notify`
-- ----------------------------
DROP TABLE IF EXISTS `t_mch_notify`;
CREATE TABLE `t_mch_notify` (
  `order_id` varchar(24) NOT NULL COMMENT '订单ID',
  `mch_id` varchar(30) NOT NULL COMMENT '商户ID',
  `mch_order_no` varchar(30) NOT NULL COMMENT '商户订单号',
  `order_type` varchar(8) NOT NULL COMMENT '订单类型:1-支付,2-转账,3-退款',
  `notify_url` varchar(2048) NOT NULL COMMENT '通知地址',
  `notify_count` tinyint(6) NOT NULL DEFAULT '0' COMMENT '通知次数',
  `result` text COMMENT '通知响应结果',
  `status` tinyint(6) NOT NULL DEFAULT '1' COMMENT '通知状态,1-通知中,2-通知成功,3-通知失败',
  `last_notify_time` datetime DEFAULT NULL COMMENT '最后一次通知时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `IDX_MchId_OrderType_MchOrderNo` (`mch_id`,`order_type`,`mch_order_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='商户通知表';

-- ----------------------------
-- Records of t_mch_notify
-- ----------------------------

-- ----------------------------
-- Table structure for `t_pay_channel`
-- ----------------------------
DROP TABLE IF EXISTS `t_pay_channel`;
CREATE TABLE `t_pay_channel` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '渠道主键ID',
  `channel_Id` varchar(24) NOT NULL COMMENT '渠道ID',
  `channel_name` varchar(30) NOT NULL COMMENT '渠道名称,如:alipay,wechat',
  `channel_mch_id` varchar(32) NOT NULL COMMENT '渠道商户ID',
  `mch_id` varchar(30) NOT NULL COMMENT '商户ID',
  `state` tinyint(6) NOT NULL DEFAULT '1' COMMENT '渠道状态,0-停止使用,1-使用中',
  `param` varchar(4096) NOT NULL COMMENT '配置参数,json字符串',
  `remark` varchar(128) DEFAULT NULL COMMENT '备注',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_MchId_MchOrderNo` (`channel_Id`,`mch_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COMMENT='支付渠道表';

-- ----------------------------
-- Records of t_pay_channel
-- ----------------------------

-- ----------------------------
-- Table structure for `t_pay_order`
-- ----------------------------
DROP TABLE IF EXISTS `t_pay_order`;
CREATE TABLE `t_pay_order` (
  `pay_order_id` varchar(32) NOT NULL COMMENT '支付订单号',
  `mch_id` varchar(32) NOT NULL COMMENT '商户ID',
  `mch_order_no` varchar(32) NOT NULL COMMENT '商户订单号',
  `channel_id` varchar(16) NOT NULL COMMENT '渠道ID',
  `amount` bigint(20) NOT NULL COMMENT '支付金额,单位分',
  `currency` varchar(16) NOT NULL DEFAULT 'cny' COMMENT '三位货币代码,人民币:cny',
  `status` tinyint(6) NOT NULL DEFAULT '0' COMMENT '支付状态,0-订单生成,1-支付中(目前未使用),2-支付成功,3-交易关闭',
  `notify_result` tinyint(6) DEFAULT '0' COMMENT '商户通知接收结果 0 未成功  1成功',
  `client_ip` varchar(16) DEFAULT NULL COMMENT '客户端IP',
  `device` varchar(64) DEFAULT NULL COMMENT '设备',
  `subject` varchar(128) NOT NULL COMMENT '商品标题',
  `body` varchar(6000) NOT NULL COMMENT '商品描述信息',
  `extra` varchar(512) DEFAULT NULL COMMENT '特定渠道发起时额外参数',
  `channel_mch_id` varchar(32) NOT NULL COMMENT '渠道商户ID',
  `channel_order_no` varchar(64) DEFAULT NULL COMMENT '渠道订单号',
  `err_code` varchar(64) DEFAULT NULL COMMENT '渠道支付错误码',
  `err_msg` varchar(128) DEFAULT NULL COMMENT '渠道支付错误描述',
  `param1` varchar(64) DEFAULT NULL COMMENT '扩展参数1',
  `param2` varchar(64) DEFAULT NULL COMMENT '扩展参数2',
  `notify_url` varchar(128) NOT NULL COMMENT '通知地址',
  `notify_count` tinyint(6) NOT NULL DEFAULT '0' COMMENT '通知次数',
  `last_notify_time` bigint(20) DEFAULT NULL COMMENT '最后一次通知时间',
  `expire_time` bigint(20) DEFAULT NULL COMMENT '订单失效时间',
  `pay_succ_time` bigint(20) DEFAULT NULL COMMENT '订单支付成功时间',
  `sett_cycle_status` tinyint(6) DEFAULT '0' COMMENT '结算状态 0:未结算 1:已结算',
  `sett_cycle_time` timestamp NULL DEFAULT NULL COMMENT '结算日期',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`pay_order_id`),
  UNIQUE KEY `IDX_MchId_MchOrderNo` (`mch_id`,`mch_order_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='支付订单表';

-- ----------------------------
-- Records of t_pay_order
-- ----------------------------

-- ----------------------------
-- Table structure for `t_refund_order`
-- ----------------------------
DROP TABLE IF EXISTS `t_refund_order`;
CREATE TABLE `t_refund_order` (
  `refund_order_id` varchar(32) NOT NULL COMMENT '退款订单号',
  `pay_order_id` varchar(32) NOT NULL COMMENT '支付订单号',
  `channel_pay_order_no` varchar(64) DEFAULT NULL COMMENT '渠道支付单号',
  `mch_id` varchar(64) NOT NULL COMMENT '商户ID',
  `mch_refund_no` varchar(32) NOT NULL COMMENT '商户退款单号',
  `mch_pay_order_id` varchar(30) NOT NULL,
  `channel_id` varchar(24) NOT NULL COMMENT '渠道ID',
  `pay_amount` bigint(20) NOT NULL COMMENT '支付金额,单位分',
  `refund_amount` bigint(20) NOT NULL COMMENT '退款金额,单位分',
  `currency` varchar(3) NOT NULL DEFAULT 'cny' COMMENT '三位货币代码,人民币:cny',
  `status` tinyint(6) NOT NULL DEFAULT '0' COMMENT '退款状态:0-订单生成,1-退款中,2-退款成功,3-退款失败',
  `result` tinyint(6) NOT NULL DEFAULT '0' COMMENT '退款结果:0-不确认结果,1-等待手动处理,2-确认成功,3-确认失败',
  `client_ip` varchar(32) DEFAULT NULL COMMENT '客户端IP',
  `device` varchar(64) DEFAULT NULL COMMENT '设备',
  `remark_info` varchar(256) DEFAULT NULL COMMENT '备注',
  `channel_user` varchar(32) DEFAULT NULL COMMENT '渠道用户标识,如微信openId,支付宝账号',
  `user_name` varchar(24) DEFAULT NULL COMMENT '用户姓名',
  `channel_mch_id` varchar(32) NOT NULL COMMENT '渠道商户ID',
  `channel_order_no` varchar(32) DEFAULT NULL COMMENT '渠道订单号',
  `channel_err_code` varchar(128) DEFAULT NULL COMMENT '渠道错误码',
  `channel_err_msg` varchar(128) DEFAULT NULL COMMENT '渠道错误描述',
  `extra` varchar(512) DEFAULT NULL COMMENT '特定渠道发起时额外参数',
  `notify_url` varchar(128) DEFAULT NULL COMMENT '通知地址',
  `param1` varchar(64) DEFAULT NULL COMMENT '扩展参数1',
  `param2` varchar(64) DEFAULT NULL COMMENT '扩展参数2',
  `expire_time` bigint(20) DEFAULT NULL COMMENT '订单失效时间',
  `refund_succ_time` bigint(20) DEFAULT NULL COMMENT '订单退款成功时间',
  `sett_cycle_time` timestamp NULL DEFAULT NULL COMMENT '结算日期',
  `sett_cycle_status` tinyint(6) DEFAULT '0' COMMENT '结算状态 0:未结算 1:已结算',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`refund_order_id`),
  UNIQUE KEY `IDX_MchId_MchRefundNo` (`mch_id`,`mch_refund_no`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='退款订单表';

-- ----------------------------
-- Records of t_refund_order
-- ----------------------------

-- ----------------------------
-- Table structure for `t_set_cycle`
-- ----------------------------
DROP TABLE IF EXISTS `t_set_cycle`;
CREATE TABLE `t_set_cycle` (
  `id` varchar(24) NOT NULL COMMENT '订单ID',
  `channel_Id` varchar(30) NOT NULL COMMENT '渠道ID',
  `channel_name` varchar(30) NOT NULL COMMENT '渠道名称',
  `set_cycle` int(11) NOT NULL COMMENT '结算周期 单位天',
  `remark` varchar(128) DEFAULT NULL COMMENT '备注',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `IDX_MchId_OrderType_MchOrderNo` (`channel_Id`,`set_cycle`,`channel_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='商户通知表';

